import React, {useState} from "react"
import logo from './logo.svg';
import './App.css';

function App() {
  const [cardNum, setCardNum] = useState(0);
  const topPane = new Image();
  topPane.src = {logo};

  const bottomPane = new Image();
  bottomPane.src = {logo};

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <div className="splitScreen">
        <div className="topPane">document.body.appendChild(topPane)</div>
        <div className="bottomPane">{bottomPane}</div>
      </div>
    </div>
  );
}

export default App;
